import React, { Component } from "react";

class Contact extends Component {
  render() {
    return (
      <div>
        <h4>John Doe</h4>
        <ul>
          <li>Email: jdoe@gmail.com</li>
          <li>Phone: 333-333-3333</li>
        </ul>
      </div>
    );
  }
}

export default Contact;
